  Gulf of Mexico, and US West Coast from 1999-01-01 to 1999-12-31 (NCEI Accession
  0127396)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 18,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2015-10-11T22:33:14.788579\",\n\t\"name\":
  \"estuarine-salinity-zones-in-us-east-coast-gulf-of-mexico-and-us-west-coast-from-1999-01-01-to-1\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"These unprojected (geographic coordinates)
  3-Zone Average Annual Salinity Digital Geographies are based on analysis of long-term
  salinity data for 147 estuaries of the contiguous United States. Each estuary is
  subdivided into three zones between the head(s) of tide, and the seaward boundaries
  based on annual-averaged and depth-averaged salinities. The salinities used to define
  the three zones are: (1) Tidal Fresh Zone (0 to 0.5 parts per thousand); (2) Mixing
  Zone (0.5 to 25 parts per thousand); (3) Seawater Zone (25 parts per thousand or
  greater).nnThis 3-zone scheme is considered static rather than dynamic, because
  it does not take into account the seasonal variations in salinity patterns and stratification
  that occur in most estuaries. Nonetheless, it provides a simple and readily understandable
  way to depict the long-term salinity characteristics of U.S. estuarine waters. Note
  that not all estuaries contain all three zones - for example, Baffin Bay, Texas,
  receives relatively little annual freshwater inflow, and is considered to be entirely
  Seawater Zone. This 3-zone scheme was originally presented in the National Estuarine
  Inventory (NEI) Data Atlas, Vol. I (NOAA/NOS 1985) for 92 estuaries of the contiguous
  United States. In the 1990s, digital geographies were refined and many estuaries
  were added to become a key layer within the Coastal Assessment Framework (NOAA 2007).nnThese
  3-Zone Average Annual Salinity Digital Geography have been used for applications
  in natural resource science and management. They provided the spatial framework
  and basis for development of NOAA's Estuarine Living Marine Resources (ELMR) Program
  (Nelson and Monaco 2000), and also for NOAA's National Estuarine Eutrophication
  Assessment (Bricker et al. 2007).\",\n\t\"license_title\": null,\n\t\"extras\":
